import React from 'react';
import TabPanel from './components/tabs.js'
import RecipeReviewCard from './components/item.js'
import Grouped from './components/searchField.js'
import FixedTags from './components/tagList.js'

function App() {

  return (


    <div id='Main'>
     <TabPanel />
     <div className='filmsPage' id='films'>
       <Grouped />
       <FixedTags/>
       <RecipeReviewCard/>
         </div>
      <div className='favourites' id='Favourites'>
      <RecipeReviewCard/>
      </div>


    </div>
  );
}

export default App;
